import React from 'react';
import Image from "./blogging.svg";

const Home =() => {
	return ( 
		<>

<div className="jumbotron jumbotron-fluid text-white bg-transparent">
  <div className="container col-6 bg-dark mr-5">
  
    
    <h1 className="display-4">Feel free to connect with us.</h1><br />
    <p className="lead">This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
    <button type="button" className="btn btn-outline-light rounded-pill">Get started</button>
     
  </div>
  
  <div className="container col-6 bg-dark">
  <img src={Image} className="float-right" alt="" height="400px" />
  </div>
 
</div>
		
		
			
		</>
		);
};

export default Home;
